import React, { useState } from "react";
import NavBar from "./NavBar";

const dataNavBarArr = [
  {
    type: "Stays",
    icon: "fa-bed",
    active: true,
  },
  {
    type: "Flights",
    icon: "fa-plane",
    active: false,
  },
  {
    type: "Car rentals",
    icon: "fa-car",
    active: false,
  },
  {
    type: "Attractions",
    icon: "fa-bed",
    active: false,
  },
  {
    type: "Airport taxis",
    icon: "fa-taxi",
    active: false,
  },
];

const Home = () => {
  return (
    <div>
      <h1>Home Page</h1>
      <NavBar />
    </div>
  );
};

export default Home;
